import React from 'react';
import PropTypes from 'prop-types';

const IsPrivateRoute = props => {
    const { path, ...isPrivateRouteProps } = props;
    // let val = '/app';
    const response = path.includes('/app');

    return response;
};

IsPrivateRoute.propTypes = {};

export default IsPrivateRoute;
